import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { listUsers } from "../actions/userActions";
import DeleteUser from "../components/DeleteUser";

export default function Users(props) {
  const dispatch = useDispatch();
  const usersList = useSelector((state) => state.userList);
  const { users } = usersList;

  useEffect(() => {
    dispatch(listUsers());
  }, [dispatch]);

  return (
    <div>
      <div>
        {/* <table>
          <tr>
            <th className="col-1">Name</th>
            <th className="col-2">Email</th>
            <th className="col-3">Id</th>
            <th className="col-4">Phone Number</th>
            <th className="col-5">Actions</th>
          </tr>
          {users?.map((user) => (
            <tr>
              <div key={user._id} user={user}>
                <td className="col-1">
                  <Link to={`/user/${user._id}`}>{user.name}</Link>
                </td>
                <td className="col-2">
                  <p>{user.email}</p>
                </td>
                <td className="col-3">
                  <p>{user._id}</p>
                </td>
                <td className="col-4">
                  <p>{user.phoneNumber}</p>
                </td>
                <td className="col-5">
                  <p>
                    <Link to="/updateUser">Update</Link>
                    (..)
                    <DeleteUser />
                  </p>
                </td>
              </div>
            </tr>
          ))}
        </table> */}

        <table>
          {users?.map((user) => (
            <>
              <tr>
                {Object?.keys(user?.map((key) => <th id={key._id}>{key}</th>))}
              </tr>

              <tr>
                {Object?.values(
                  user?.map((val) => <td id={val._id}>{val}</td>)
                )}
              </tr>
            </>
          ))}
        </table>
      </div>
    </div>
  );
}
